If we copy an object, what do we do about any references within that object? In a shallow copy , we simply assign those references to the new object. Thus, both copies of the object have references to the same "nested" objects. In a deep copy , however, all nested objects must also be copied meaning that each copies of the object have references to different nested objects. public class SBArray
{ private StringBuilder [] A; private int size; // shallow copy public SBArray(SBArray old) { A = old.A; size = old.size; } // deeper copy public SBArray(SBArray old) { A = new StringBuilder[ old.A.length]; size = old.size for (int i=0; i<size; i++) A[i] = old.A[i]; }
} Shallow Copy Deeper Copy Deep Copy Copy references from old object to new object. We make a copy of the array for the new object We make a copy of the array for the new object Objects within the copied object are shared by original and copy But we do not copy the StringBuilders stored within it We also copy all of the StringBuilders stored in the array Original and copy are still "connected" at some point Original and copy are completely separated from each other Generally speaking, (true) deep copying is more difficult than shallow copying. This is because for a deep copy, we need to follow all references in the original and make copies for the copy which could be several levels deep. For example, a object has a reference to front node. A shallow copy would only copy this single reference, but, a deep copy would have to traverse the entire list, copying each node, and copying the data in each node, and so on.... In fact, it's impossible to say that a copy is truly deep unless all copies made are deep.

