Besides, composition, another technique to building classes is called inheritance . With inheritance, we build a new class (subclass) by extending a previously-defined class (superclass). Note that the subclass has all of the properties(data and methods) defined in the superclass. Inheritance defines an is-a relationship between subclass and superclass. That is, a subclass is a superclass, and subclass objects can be assigned to superclass variables. However, the opposite is not true. That is, as superclass IS NOT a subclass and superclass objects cannot be assigned to subclass variables. // Assume SubFoo is a subclass of Foo – consider the
// statements below
Foo f1;
SubFoo s1;
f1 = new Foo(); // obviously fine
f1 = new SubFoo(); // fine, but now we // only have access to the public methods and // variables initially defined in class Foo()
f1.foomethod(); // fine
f1.subfoomethod(); // illegal – method does not exist
((SubFoo)f1).subfoomethod(); // fine, since now ref. // has been cast to the actual class
s1 = new SubFoo();
s1.subfoomethod();
s1.foomethod();
s1 = new Foo(); // illegal – isA is one way Polymorphism Polymorphism allows superclass and subclass objects to be accessed in a regular, consistent way. For example, an array or collection of superclass references can be used to access a mixture of superclass and subclass objects . So, if a method is defined in both the superclass and subclass (with identical signatures), the version corresponding to each class will be used in a call from the array. The idea is that the methods are similar in nature but the redefinition in the subclass gears the method more specifically to the data / properties of the subclass. For example, consider the class Animal which describes a large number of objects. Let's say each Animal can move(). Without more knowledge of the specific animal, we don't really know how the animal would move. But now, consider a subclass of Animal, say Bird. We can redefine (override) the move() method to reflect the specific details of a Bird such as, it will fly. public class Animal
{ // omitted decls public void move() { System.out.println("I move"); }
} public class Bird extends Animal
{ // omitted decls public void move() { System.out.println("I fly"); }
} Generally, each subclass would override the move() method in its own way. Animal [] A = new Animal[3];
A[0] = new Bird();
A[1] = new Person();
A[2] = new Fish();
for (int i = 0; i < A.length; i++) A[i].move(); Notice that each call is syntactically identical . Their reference and method spec(s) are the same; but the code is executed is based on type of object being stored Polymorphism is implemented utilizing two important ideas: (1) Method Overriding and (2) Dynamic (or late) Binding When a superclass's method is redefined in the subclass with an identical method signature , this is called method overriding . Since the signatures are identical, rather than overloading the method (ad hoc polymorphism), it is instead overriding the method . For a subclass object, the definition in the subclass replaces the version in the superclass, even if a superclass reference is used to access the object Superclass version can still be accessed via the super reference Dynamic (or late) Binding Dynamic binding means that the code executed for a method call is associated with the call during run-time . The actual method executed is determined by the type of the object , not the type of the reference. Polymorphism is very useful if we want to access collections of mixed data types consistently. For example, a collection of different graphical figures could call each draw() method consistently, but which would be drawn differently.

