Unlike some programming langauges, Java allows only single inheritance . That is, one class cannot have more than one parent. Java language developers chose to offer only single inheritance for two basic reasons: 1. simplifying the implementation of the compiler/interpreter 2. it's easier for programmers to understand what is happening when there is only single inheritance However, it is sometimes useful to access an object through more than one type of superclass references. Often, when a programmer wants multiple inheritance, they want it for polymorphism (i.e. they want a class to be able to look like two different other things). Java offers a way to do this with interfaces . An interface is a named set of methods (i.e. method headers, but no bodies). Basically, an interface is an abstract class without any instance data (although there are differences between abstract classes and interfaces). In interfaces: Static constants are allowed Default methods are allowed Static methods are allowed No instance data is allowed Regular instance methods have no bodies Interface itself cannot be instantiated Any Java class can implement an interface (no matter what its inheritance). In fact, any Java class can implement multiple interfaces . To implement an interface, a class must declare so in the class header and implement all methods in the interface. For example, consider the following interfaces: public interface Laughable
{ public void laugh();
}
public interface Booable
{ public void boo();
} Note that any Java class can implement Laughable by implementing the method laugh(), implement Booable by implementing the method boo(). public class Comedian implements Laughable, Booable
{ // various methods here (constructor, etc.) public void laugh() { System.out.println(“Ha ha ha”); } public void boo() { System.out.println(“You stink!”); }
} All of the polymorphism behavior also applies to interfaces. The interface acts as a superclass and the implementing classes are like subclasses to it. An interface reference variable can be used to reference any object that implements that interface and only interface methods are accessible through that interface reference. Laughable [] funny = new Laughable[3];
funny[0] = new Comedian();
funny[1] = new SitCom(); // implements Laughable
funny[2] = new Clown(); // implements Laughable
for (int i = 0; i < funny.length; i++) funny[i].laugh();

