Many lower level programming languages, such as C, support pointer variables which stores memory addresses and allow us to directly access data in the RAM. Pointers Here, variables x and y are pointers which store memory locations. The objects themselves live at the memory locations the pointer points to. Note, since these variables holds an address, operations on the variables means operations on the addresses (and not the data at the address). For instance, if we run x = y;, we would have both x and y pointing to the same memory location (and hence the same object). aliasing.png Now, x is no longer pointing to the original memory address, but at the same address y is pointing to. When, two (or more) pointers point to the same object, this is called aliasing . To gain access to the object that x points to, we can dereference a pointer (explicitly tell the computer to go to that address). In C, this is done with the * operator. Hence, if we really wanted to have two separate objects, but want one of them to be a copy of the other, we could do the following (assuming the data is set up properly): *x = *y; Now, x is points to its original location (as does y), but the values at the position x is pointing to is changing: dereferencing a pointer Java, by contrast, does not have any pointers. Instead, it only has references which behave similarly to pointers but with more restrictions. For instance, we cannot explicitly dereference variables (thus there is no dereference operator). Instead, dereferencing is handled implicitly and we can access data and methods using the "dot" operator. For example, to copy an an entire object we would use a method such as a clone() method (also called a copy constructor ). Yet, even without pointers, aliasing can still occur in Java. StringBuilder S1 = new StringBuilder("Hello");
StringBuilder S2 = S1;
S1.append(" There");
S2.append(" CS 0445 Students");
System.out.println(S1.toString());
// Output: Hello There CS 0445 Students Here, we mutated using two different variables but both mutated the same object. Hence, you must be aware of when you want a new object or a reference to an old one.
